import React from "react";
import "./style.css";

function CardBtn(props) {
  return (
    <button onClick={props.onClick} className={`card-btn ${props["data-value"]}`} {...props} />
  );
}

export default CardBtn;

<a href="#" class="btn btn-primary">Go somewhere</a>
